package original;

import org.junit.Test;
import static org.junit.Assert.*;

import java.util.ArrayList;
import java.util.List;

public class FTest {

    @Test
    public void testFactorial() {
        int result = F.factorial(5);
        assertEquals(120, result);
    }

    @Test
    public void testFactorialWithZero() {
        int result = F.factorial(0);
        assertEquals(1, result);
    }

    @Test
    public void testFactorialWithNegativeNumber() {
        int result = F.factorial(-5);
        assertEquals(1, result);
    }

    @Test
    public void testFactorialWithLargeNumber() {
        int result = F.factorial(10);
        assertEquals(3628800, result);
    }

    @Test
    public void testF() {
        List<Integer> result = F.f(5);
        List<Integer> expected = new ArrayList<>();
        expected.add(1);
        expected.add(3);
        expected.add(6);
        expected.add(10);
        expected.add(15);
        assertEquals(expected, result);
    }

    @Test
    public void testFWithZero() {
        List<Integer> result = F.f(0);
        List<Integer> expected = new ArrayList<>();
        assertEquals(expected, result);
    }

    @Test
    public void testFWithNegativeNumber() {
        List<Integer> result = F.f(-5);
        List<Integer> expected = new ArrayList<>();
        assertEquals(expected, result);
    }

    @Test
    public void testFWithLargeNumber() {
        List<Integer> result = F.f(10);
        List<Integer> expected = new ArrayList<>();
        expected.add(1);
        expected.add(3);
        expected.add(6);
        expected.add(10);
        expected.add(15);
        expected.add(21);
        expected.add(28);
        expected.add(36);
        expected.add(45);
        expected.add(55);
        assertEquals(expected, result);
    }

    @Test
    public void testSum() {
        int result = F.sum(5);
        assertEquals(15, result);
    }

    @Test
    public void testSumWithZero() {
        int result = F.sum(0);
        assertEquals(0, result);
    }

    @Test
    public void testSumWithNegativeNumber() {
        int result = F.sum(-5);
        assertEquals(0, result);
    }

    @Test
    public void testSumWithLargeNumber() {
        int result = F.sum(10);
        assertEquals(55, result);
    }
}

